/**
 * TSO Message interface for one of TSO/E messages
 * @export
 * @memberOf ITsoMessage
 */
export interface ITsoMessage {
    /**
     * JSON version for message format
     * @type string
     * @memberOf ITsoMessage
     */
    "VERSION": string;
    /**
     * description of the data type
     * @type string
     * @memberOf ITsoMessage
     */
    "DATA": string;
}
